 a reference to his long chin (\\\"baba\\\" is the Filipino term for \\\"chin\\\") of which was sometimes a subject of on screen ridicule, usually by himself.\\nPersonal life\\nHe grew up in Sampaloc, Manila in his grandmother's home with his mother, one sister and three brothers. Babalu fathered a son. For several years and until his death, he was living with his long-time partner who eventually became his wife prior to his death, with whom he had a child.\\n\\nActing career\\nBabalu is considered as \\\"one of the most famous and beloved comedians\\\" in the Philippines. He is the nephew of the famous actor Panchito Alba. Dolphy, the king of Philippine Comedy, discovered Babalu's talent as a comedian. Babalu was given a featured role on the Philippines' leading comedy-variety show Buhay Artista. His appearances in movies and television included the shows Home Along Da Riles and Oki Doki Doc. Babalu's life story was featured on the television show Maalaala Mo Kaya \\\"Imahe ng Berhen\\\" on July 3, 2003.\\nHe died of liver cancer on August 27, 1998, two months after his 56th Birthday, in his home at Antipolo City. He was buried in Loyola Memorial Park in Parañaque City. The film Tar-San is dedicated to his memory.\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/dU-UrIjDoNc\/hqdefault.jpg?sqp=-oaymwEYCKgBEF5IVfKriqkDCwgBFQAAiEIYAXAB\\u0026rs=AOn4CLAYLRl87bVJq7fjzsXKEFxBh-viHw\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/dU-UrIjDoNc\/hqdefault.jpg?sqp=-oaymwEYCMQBEG5IVfKriqkDCwgBFQAAiEIYAXAB\\u0026rs=AOn4CLAOyg3o2LX1GX3P-osPonk2x4ULaw\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/dU-UrIjDoNc\/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==\\u0026rs=AOn4CLAZB4gSq56drYrC0LntZYjP_zMjFw\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/dU-UrIjDoNc\/hqdefault.jpg?sqp=-oaymwEZCNACELwBSFXyq4qpAwsIARUAAIhCGAFwAQ==\\u0026rs=AOn4CLA5hipL0q3-ROz9O9VlRSD ng career\nBabalu is considered as \"one of the most famous and beloved comedians\" in the Philippines. He is the nephew of the famous actor Panchito Alba. Dolphy, the king of Philippine Comedy, discovered Babalu's talent as a comedian. Babalu was given a featured role on the Philippines' leading comedy-variety show Buhay Artista. His appearances in movies and television included the shows Home Along Da Riles and Oki Doki Doc. Babalu's life story was featured on the television show Maalaala Mo Kaya \"Imahe ng Berhen\" on July 3, 2003.\nHe died of liver cancer on August 27, 1998, two months after his 56th Birthday, in his home at Antipolo City. He was buried in Loyola Memorial Park in Parañaque City. The film Tar-San is dedicated to his memory.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/dU-UrIjDoNc/hqdefault.jpg?sqp=-oaymwEYCKgBEF5IVfKriqkDCwgBFQAAiEIYAXAB\u0026rs=AOn4CLAYLRl87bVJq7fjzsXKEFxBh-viHw","width":168,"height":94},{"url":"https://i.ytimg.com/vi/dU-UrIjDoNc/hqdefault.jpg?sqp=-oaymwEYCMQBEG5IVfKriqkDCwgBFQAAiEIYAXAB\u0026rs=AOn4CLAOyg3o2LX1GX3P-osPonk2x4ULaw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/dU-UrIjDoNc/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==\u0026rs=AOn4CLAZB4gSq56drYrC0LntZYjP_zMjFw","width":246,"height":138},{"url":"https://i.ytimg.com/vi/dU-UrIjDoNc/hqdefault.jpg?sqp=-oaymwEZCNACELwBSFXyq4qpAwsIARUAAIhCGAFwAQ==\u0026rs=AOn4CLA5hipL0q3-ROz9O9VlRSD6vEMYjg","width":336,"height":188}]},"averageRating":4.7636547,"allowRatings":true,"viewCount":"1467964","author":"Filipino Comedy Channel","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsUrlsRenderer":{"invideoUrl":"//www.youtube.com/annotations_invideo?cap_hist=1\u0026video_id=dU-UrIjDoNc\u0026client=1","loadPolicy":"ALWAYS","allowInPlaceSwitch":false}}],"playerConfig":{"audioConfig":{"loudnessDb":3.7409992,"perceptualLoudnessDb":-17.259001},"playbackStartConfig":{"startSeconds":
